import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { Alert } from 'src/app/interface/alert';
import { Title } from '@angular/platform-browser';

@Component({
	selector: 'app-contact',
	templateUrl: './contact.component.html',
	styleUrls: ['./contact.component.scss'],
})
export class ContactComponent implements OnInit {
	contactForm!: FormGroup;
	alertDetails: Alert = {} as Alert;

	constructor(private title: Title) {}

	ngOnInit(): void {
		this.title.setTitle('Purilo | Contact Us');
		this.contactForm = new FormGroup({
			name: new FormControl('', Validators.required),
			email: new FormControl('', [
				Validators.required,
				Validators.pattern('^[\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,4}$'),
			]),
			message: new FormControl(''),
		});
	}

	submit() {
		if (this.contactForm.valid) {
			this.alertDetails = {
				isSuccessMessage: true,
				message: 'We have received your message.',
			};
		} else {
			this.alertDetails = {
				isErrorMessage: true,
				message: 'Please fill the mandatory fields',
			};
		}
	}

	get name(): FormControl {
		return this.contactForm.get('name') as FormControl;
	}

	get email(): FormControl {
		return this.contactForm.get('email') as FormControl;
	}

	get message(): FormControl {
		return this.contactForm.get('message') as FormControl;
	}
}
<div class="page-container">
	<div class="container">
		<h1 class="page-heading">Contact Us</h1>
		<div class="contact-wrapper">
			<div class="contact-form">
				<h2>Get in touch</h2>
				<app-alert [alertDetails]="alertDetails"></app-alert>
				<form (ngSubmit)="submit()" [formGroup]="contactForm">
					<div class="form-group">
						<label class="form-label" for="name">Name*</label>
						<input
							class="form-input"
							formControlName="name"
							id="name"
							type="text"
						/>
						<div
							*ngIf="(name.dirty || name.touched) && name.invalid"
							class="inline_error"
						>
							<span *ngIf="name.hasError('required')">
								Name is required
							</span>
						</div>
					</div>
					<div class="form-group">
						<label class="form-label" for="email">Email*</label>
						<input
							class="form-input"
							formControlName="email"
							id="email"
							type="text"
						/>
						<div
							*ngIf="
								(email.dirty || email.touched) && email.invalid
							"
							class="inline_error"
						>
							<span *ngIf="email.hasError('required')">
								Email is required
							</span>
							<span *ngIf="email.hasError('pattern')">
								Invalid email address
							</span>
						</div>
					</div>
					<div class="form-group">
						<label class="form-label" for="message">Message</label>
						<textarea
							class="form-input"
							cols="30"
							formControlName="message"
							id="message"
							name="message"
							rows="10"
						></textarea>
					</div>
					<button class="btn btn-primary">Submit</button>
				</form>
			</div>
			<div class="address">
				<section>
					<h2>Address</h2>
					<p>Plot no 123</p>
					<p>Electronic City</p>
					<p>Bangalore, India</p>
				</section>

				<section>
					<h2>Contact</h2>
					<p>Mobile: (+91) 9054 123 456</p>
					<p>Office: (+91) 9876 123 456</p>
				</section>
			</div>
		</div>
	</div>
</div>
